`,paraId:319,tocIndex:49},{value:"7. \u591A\u7EC4\u4EF6\u5171\u4EAB\u6570\u636E",paraId:320,tocIndex:49},{value:"\u76EE\u6807\uFF1A\u5F53\u6570\u636E\u53D1\u751F\u53D8\u5316 \u6240\u6709\u7528\u5230\u6570\u636E\u7684\u7EC4\u4EF6\u90FD\u4F1A\u5F97\u5230\u540C\u6B65\u7684\u7EC4\u4EF6\u7684\u66F4\u65B0",paraId:321,tocIndex:49},{value:"\u5B9E\u73B0\u6B65\u9AA4\uFF1A\u5728 Foo \u7EC4\u4EF6\u548C Bar \u7EC4\u4EF6\u4E2D\u5206\u522B\u4F7F\u7528 store \u4E2D\u7684\u6570\u636E\uFF0C\u7136\u540E\u5728 app \u7EC4\u4EF6\u4E2D\u8FDB\u884C\u6570\u636E\u4FEE\u6539\uFF0C\u67E5\u770B Foo \u7EC4\u4EF6\u548C Bar \u7EC4\u4EF6\u662F\u5426\u5F97\u5230\u66F4\u65B0",paraId:322,tocIndex:49},{value:`// Bar.jsx

